package week5.day1;

public class Fibonacci {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int a = 0;
		
		System.out.println(a);
		
		int b = 1;
		
		System.out.println(b);
		
		for (int i = 02; i <=8; i++) {
			
			
		int	sum = a+b;
			
		System.out.println(sum);	
			
			a=b;
			b=sum;
			
		}

	}

}
